import React from "react";
import styles from './UserList.module.css'

const UserList = (props) => {
    console.log(props.dataToRender);

if (props.dataToRender.length === 0) {
       return <p>No cards added yet.</p>
      };

    return (
        <div className={styles.users}> <ul>{ props.dataToRender.map((card) => (<li>{card.Username}({card.Age} years old)</li>))}</ul></div>  

   );
};

export default UserList;
